import React from 'react'
import { Link } from 'react-router-dom';
import styled from 'styled-components'

const Container = styled.div`
width:${(props) => props.type === "sm" && "360px"};
margin-bottom:${(props) => props.type === "sm" ? "10px" : "45px"};
cursor:pointer;
display:${(props) => props.type === "sm" && "flex"};
gap:10px;
`;
const Image = styled.img`
width:100%;
height:${(props) => props.type === "sm" ? "120px" : "202px"};
background-color:#999;
flex:1;
`;
const Details = styled.div`
display:flex;
margin-top:${(props) => props.type === "sm" && "16px"};
gap:12px;
felx:1;
`;
const ChannelImage = styled.img`
width:36px;
height:36px;
border-radius:50%;
background-color:#999;
display:${(props) => props.type === "sm" && "none"};
`;
const Texts = styled.div`

`;

const Title = styled.h1`
font-size:16px;
font-weight:500;
color:${({theme})=>theme.text};
`;

const ChannelName = styled.h2`
font-size:14px;
color:${({theme})=>theme.textSoft};
margin:9px 0;
`;

const Info = styled.div`
font-size:14px;
color:${({theme})=>theme.textSoft};
`;

export default function Card({type, video}) {
  return (
    <Link to="/video/test" style={{textDecoration:"none"}}>
    <Container type={type}>
      <Image type={type} src={video.img}/>
        <Details type={type}>
            <ChannelImage type={type} src='https://urpgstatic.com/images/pokemon-home.png'/>
            <Texts>
                <Title>Test Video</Title>
                <ChannelName>WING</ChannelName>
                <Info>{video.views} views {video.createdAt}</Info>
            </Texts>
        </Details>

    </Container>
    </Link>
  )
}
